const Promise = require('bluebird');
const fs = require('fs');
const progress = require('progress');

const mysql = require('mysql');
const db = mysql.createConnection({
    host: 'localhost',
    user: 'root',
    password: '',
    multipleStatements: true
});

fs.readFile('database.sql', 'utf8', (err, data) => {
    let lines = data.split('\n');
    let sqlLines = [];
    Promise.map(lines, (line, index) => {
        if (line.charAt(0) !== '-' && line.trim() !== '')
            sqlLines.push(line);
    }).then(() => {
        let requests = sqlLines.join('\n').split(';');

        let bar = new progress('  Creating database [:bar] :percent :etas', {
            complete: '=',
            incomplete: ' ',
            width: 20,
            total: requests.length
        });

        Promise.each(requests, (request) => {
            request.replace('\r\n', '').replace('\n', '').replace('\r', '');
            return new Promise((resolve, reject) => {
                db.query(request + ';', (err, result) => {
                    if (err && err.code !== 'ER_EMPTY_QUERY')
                        return reject(err);
                    bar.tick(1);
                    return resolve();
                })
            });
        }).then(() => {
            step2();
        }).catch((err) => {
            bar.interrupt('Error SQL : ', err.code);
            return process.exit();
        });
    });
});

